css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("deviantart.com") {

#searchArea {
right: 20px!important;
left:auto!important;
}

#searchCap {
    background:url(data:image/gif;base64,%3D%3D) no-repeat 0px 0px !important;
}



#searchArea input.sleekSearchInput {
   background:url(data:image/gif;base64,%3D%3D) repeat-x 0px -92px !important;
}


#searchDropdown {
Color:#000000!important;
}

#searchDropdown {
   background:url(data:image/gif;base64,%3D%3D) no-repeat 0px -23px !important;
}

#searchDropdown div.textTop {
    z-Index: 191 !important; 
    color: #000000 !important;
}

#searchDropdown:hover {
    background:url(data:image/gif;base64,%3D%3D) no-repeat 0px -69px !important;
}


#searchButton {
    background:url(data:image/gif;base64,%3D%3D) no-repeat -138px -23px !important;
}


#searchButton:hover {
    background:url(data:image/gif;base64,%3D%3D) no-repeat -138px -69px !important;
}

#searchButton:active {
    background:url(data:image/gif;base64,%3D%3D) no-repeat -138px -46px !important;
}

#noTouch #searchDropdownOverlay {
    background:url(data:image/gif;base64,%3D%3D) no-repeat -1px -47px !important;
    right: 55px!important;
left:auto!important;
}



#noTouch #searchDropdownMenu {
    background:#829586 !important;
    right: 55px!important;
left:auto!important;
   	padding-top:6px!important;
	padding-bottom:8px!important;
	-moz-border-radius-bottomright: 1em !important;
	-moz-border-radius-bottomleft: 1em !important;
}


#noTouch #searchDropdownMenu div.sdmItem {
    line-height: 23px !important;
}

#noTouch #searchDropdownMenu div.sdmItemHover {
    background: url(data:image/gif;base64,R0lGODlhAQAYALMAAENVTGl7b15wZYKVhnOGeXyPgFNlWlNmW0pdU0pcUnyPgXOGeF5xZUNWTQAAAAAAACH5BAAAAAAALAAAAAABABgAQAQPcAAgAFtpIqKCmWBzBEUEADs%3D) !important;
    color: #ffffff !important;
}

#noTouch #searchDropdownMenu div.sdmItem  div.textTop {
    color: #000000 !important;
}

#noTouch #searchDropdownMenu div.sdmItemHover div.textTop {
color:#ffffff!important;
}



#appBar, #appFolderButtonIcon {
left:-360px!important;
}

#appFolder, #moreUsageHint, #moreAdFrame {
left:110px!important;
}

#appFolderShadow {
left:90px!important;
}


#top-55 #rockdocklock #exitlink {
background:url(data:image/gif;base64,R0lGODlhDAASAJEAAEBTSkFaYWh+cFlaSiH5BAAAAAAALAAAAAAMABIAQAIdhI+ZIaPH3ANx0mbr1I8rb22YKHWjWX6nmi6rVQAAOw%3D%3D) no-repeat 42px 7px!important;
padding-left:5px!important;
margin-right:5px!important;
}

#top-55 #rockdocklock #exitlink:hover {
background:url(data:image/gif;base64,R0lGODlhDAASAJEAAEBTSkFaYWh+cFlaSiH5BAAAAAAALAAAAAAMABIAQAIdhI+ZIaPH3ANx0mbr1I8rb22YKHWjWX6nmi6rVQAAOw%3D%3D) no-repeat 42px 7px!important;
}

#top-55 #rockdock #menuHover span.userlink, #top-55 #rockdocklock #rockdock-message-count a, #top-55 #menuHover a {
color:#96a19b!important;
}

#top-55 #rockdocklock #rockdock-message-count:hover a, #top-55 #menuHover:hover a {
color:#afbfb6!important;
}
span[id="rockdocklock"] {
margin-left: 4px! important;
}

#top-55 #rockdocklock a[href="http://my.deviantart.com/services/#subscription"] {
width:0px!important; font-size:0px!important;
}
}
